import './App.css';
import {BrowserRouter, Routes, Route } from 'react-router-dom';
import Navbar from './components/Navbar'
import React from 'react';

function App() {
  return (
    <>
     <Routes>
        <Route exact path='/' element={<Navbar/>}/>
    </Routes>
    </>
  );
}

export default App;
